</div><div id="wb_element_instance61" class="wb_element" style="left: 501px; top: 130px; width: 200px; height: 26px; min-width: 200px; min-height: 26px; z-index: 146;  line-height: normal;"><p class="wb-stl-normal">1. Soda</p>
</div><div id="wb_element_instance62" class="wb_element" style="left: 500px; top: 165px; width: 210px; height: 180px; min-width: 210px; min-height: 180px; z-index: 147;"><img alt="" src="gallery/ac95c3e7a5e1685f4f63172cd680f7e6_210x180.jpg" style="width: 210px; height: 180px;"></div><div id="wb_element_instance63" class="wb_element" style="left: 713px; top: 166px; width: 280px; height: 182px; min-width: 280px; min-height: 182px; z-index: 148;  line-height: normal;"><p class="wb-stl-normal">Soda is extremely calorie-dense, has no nutritional value, and for various reasons, you shouldn't be dumping massive amounts of simple sugars into your system. There is debate over if diet soda is neutral or still bad for you; our suggestion is to limit it, too.</p>
</div><div id="wb_element_instance64" class="wb_element" style="left: 501px; top: 440px; width: 200px; height: 26px; min-width: 200px; min-height: 26px; z-index: 149;  line-height: normal;"><p class="wb-stl-normal">2. Sugary foods</p>
</div><div id="wb_element_instance65" class="wb_element" style="left: 502px; top: 471px; width: 210px; height: 210px; min-width: 210px; min-height: 210px; z-index: 150;"><img alt="" src="gallery/66a8561849984c3eb016303211b1b2c9_210x210.jpg" style="width: 210px; height: 210px;"></div><div id="wb_element_instance66" class="wb_element" style="left: 716px; top: 472px; width: 270px; height: 260px; min-width: 270px; min-height: 260px; z-index: 151;  line-height: normal;"><p class="wb-stl-normal">For those with a sweet tooth, all kinds of sweets are calorie monsters. But the worst of the worst may be ice cream, especially premium ice creams - a pint might give you a few days worth of saturated fat and half the calories you should be taking in. You don't need to never eat something sweet again - that's ludicrous. Just eat it rarely and in smaller amounts.</p>
</div><div id="wb_element_instance67" class="wb_element" style="left: 501px; top: 770px; width: 200px; height: 26px; min-width: 200px; min-height: 26px; z-index: 152;  line-height: normal;"><p class="wb-stl-normal">3. Fast food</p>
</div><div id="wb_element_instance68" class="wb_element" style="left: 499px; top: 799px; width: 230px; height: 190px; min-width: 230px; min-height: 190px; z-index: 153;"><img alt="" src="gallery/302be7e7bac77aeeda3d29e13d6122d0_230x190.jpg" style="width: 230px; height: 190px;"></div><div id="wb_element_instance69" class="wb_element" style="left: 734px; top: 799px; width: 260px; height: 182px; min-width: 260px; min-height: 182px; z-index: 154;  line-height: normal;"><p class="wb-stl-normal">Fast food is almost always extremely unhealthy, high in saturated fat and trans fat, very calorie-dense, and should thus be avoided by everyone. The occasional burger is harmless in the grand scheme of things, but if fast food is a staple of your diet, cut it out.</p>
